import styled from "styled-components";

export const Search = styled.div`
    margin-top: 20px;

    input {
        color: #fff;
        outline: 0;
        width: 100%;
        padding: 20px;
        border-radius: 10px;
        border: 2px solid #797A81;
        background-color: transparent;
    }
`
